import React, { Component } from 'react';
import { Switch, Route } from 'react-router-dom';
import Home from './pages/Home';
import Gravacoes from './pages/Gravacoes';
import Conteudo from './pages/Conteudo';
import PageNotFound from './pages/Conteudo';

class App extends Component {
  render() {
    return (
      <Switch>
        <Route exact path="/" component={ Home } />
        <Route exact path="/gravacoes" component={ Gravacoes } />
        <Route exact path="/conteudo" component={ Conteudo } />
        <Route exact path="/conteudo/:slug" component={ ConteudoDetalhes } />
        <Route exact path="*" component={ PageNotFound } />
      </Switch>
    )
  }
}


export default App;
